import './main.css';
import { ScrollIndicator } from '@src/ui/common/element/scrollIndicator';

const HomeIndexSection = props => <div className='homeIndexSection'>
  <ScrollIndicator style={{ visibility: 'hidden', }} />
  <h1 className='targetLogoPlace' {...props}>MUsoftware</h1>
  <ScrollIndicator />
</div>;

export { HomeIndexSection }
